import { UserListItem } from "./UserListItem";
import { UserType } from "../main/types";

type Props = {
  users: UserType[];
  selectedUserId: string;
  onUserChange: any;
};

export function UserList({ users, selectedUserId, onUserChange }: Props) {
  return (
    <ul className="user-list">
      {users.map((user) => (
        <UserListItem user={user} selectedUserId={selectedUserId} />
      ))}
    </ul>
  );
}
